column23:
В приведенной таблице указывается примерное количество корма, необходимое вашему питомцу (из расчета его веса). Однако следует помнить, что эти цифры условны, и при расчете количества корма нужно принимать во внимание такие важные факторы, как:
степень активности вашей собаки;
темперамент (животное, испытывающее стресс, сжигает больше калорий);
метаболизм. Каждое животное имеет индивидуальную скорость обмена веществ, поэтому две собаки одной породы, одного возраста и веса могут иметь совершенно разную потребность в калориях.
При определении ежедневной порции корма следует также ориентироваться на аппетит, внешний вид питомца и на качество его стула – это малоприятный, но весьма важный показатель здоровья собаки. Важно также знать точный вес животного и всегда отмерять ему соответствующую порцию.

